const Reducer = (state, action) => {
	switch (action.type) {
		case 'ALREADY LOGIN':
			console.log('called')
			console.log({ ...state, isLogin: true })
			return { ...state, isLogin: true }
		case 'ALREADY LOGOUT':
			return { ...state, isLogin: false }
		default:
			return state
	}
}
export default Reducer
